DROP TABLE IF EXISTS mtl_items cascade;
DROP TABLE IF EXISTS po_agents cascade;
DROP TABLE IF EXISTS po_vendors cascade;
DROP TABLE IF EXISTS po_vendor_sites cascade;
DROP TABLE IF EXISTS po_vendor_site_contacts cascade;
DROP TABLE IF EXISTS po_headers CASCADE;
DROP TABLE IF EXISTS po_lines CASCADE;
DROP TABLE IF EXISTS ap_agents cascade;
DROP TABLE IF EXISTS ap_invoice_headers CASCADE;
DROP TABLE IF EXISTS ap_invoice_lines CASCADE;

CREATE TABLE IF NOT EXISTS po_agents (
	po_agent_id serial PRIMARY KEY,
	first_name VARCHAR NOT NULL ,
	last_name VARCHAR,
	authorization_limit INT,
	start_date_active DATE NOT NULL,
	end_date_active date NOT NULL,
	email VARCHAR NOT NULL,
	created_date timestamp NOT NULL DEFAULT now(),
	last_updated_date timestamp NOT NULL DEFAULT now()
);



create table IF NOT EXISTS mtl_items (
	item_id serial PRIMARY key,
	item_name VARCHAR NOT NULL,
	uom_code VARCHAR NOT NULL,
	description VARCHAR,
	inactive_date date,
	created_date timestamp NOT NULL DEFAULT now(),
	last_updated_date timestamp NOT NULL DEFAULT now()
);



create table IF NOT EXISTS po_vendors (
	vendor_id serial PRIMARY key,
	vendor_code VARCHAR,
	vendor_name VARCHAR,
	created_date timestamp NOT NULL DEFAULT now(),
	last_updated_date timestamp NOT NULL DEFAULT now()
);



create table IF NOT EXISTS po_vendor_sites (
	vendor_site_id serial PRIMARY key,
	vendor_id int REFERENCES po_vendors,
	vendor_site_code VARCHAR UNIQUE NOT null,
	vendor_site_name VARCHAR NOT null,
	address_line_1 VARCHAR NOT null,
	address_line_2 VARCHAR,
	city VARCHAR,
	zip_code VARCHAR,
	country_code VARCHAR,
	purchasing_site_flag VARCHAR,
	payment_site_flag VARCHAR,
	created_date timestamp NOT NULL DEFAULT now(),
	last_updated_date timestamp NOT NULL DEFAULT now()
);



create table IF NOT EXISTS po_vendor_site_contacts (
	vendor_contact_id serial primary key,
	vendor_site_id int REFERENCES po_vendor_sites,
	inactive_date DATE,
	first_name VARCHAR NOT null,
	last_name VARCHAR,
	email VARCHAR,
	phone VARCHAR,
	url VARCHAR,
	created_date timestamp NOT NULL DEFAULT now(),
	last_updated_date timestamp NOT NULL DEFAULT now()
);


CREATE TABLE IF NOT EXISTS lookup_hdr (
	lookup_hdr_id serial PRIMARY KEY,
	lookup_type varchar NOT NULL UNIQUE,
	created_date timestamp NULL DEFAULT now(),
	last_updated_date timestamp NULL DEFAULT now()
);

CREATE TABLE IF NOT EXISTS lookup_dtl (
	lookup_dtl_id serial PRIMARY KEY,
	lookup_hdr_id int REFERENCES lookup_hdr,
	lookup_code varchar NOT NULL,
	lookup_description varchar NULL,
	start_active_date date NOT NULL,
	end_active_date date NOT NULL,
	created_date timestamp NULL DEFAULT now(),
	last_updated_date timestamp NULL DEFAULT now(),
	CONSTRAINT lookup_dtl_lookup_hdr_id_lookup_code_key UNIQUE (lookup_hdr_id,
lookup_code));

DELETE
FROM
	lookup_dtl
WHERE
	lookup_hdr_id IN (
	SELECT
		lookup_hdr_id
	FROM
		lookup_hdr
	WHERE
		lookup_type IN ('PO_STATUS', 'PO_LINE_STATUS', 'AP_STATUS'));

DELETE FROM lookup_hdr WHERE lookup_type in ('PO_STATUS', 'PO_LINE_STATUS', 'AP_STATUS');




create TABLE IF NOT exists po_headers (
	po_header_id serial PRIMARY key,
	po_number VARCHAR NOT NULL unique,
	agent_id INT REFERENCES po_agents,
	status int NOT null,
	po_created_date DATE,
	approved_flag boolean,
	approved_date DATE,
	order_amount INT,
	closed_date date,
	approved_amount INT,
	vendor_site_id INT REFERENCES po_vendor_sites,
	po_type VARCHAR,
	vendor_contact_id int REFERENCES po_Vendor_site_contacts,
	created_date timestamp NOT NULL DEFAULT now(),
	last_updated_date timestamp NOT NULL DEFAULT now()
);

CREATE TABLE IF NOT exists po_lines (
	po_line_id serial PRIMARY key,
	po_header_id int REFERENCES po_headers,
	line_num SMALLINT,
	unit_price int NOT null,
	quantity int not NULL,
	discount_percentage float,
	discount_amount int,
	item_id int REFERENCES mtl_items,
	line_status int,
	uom_code varchar,
	allow_invoice_price_override_flag boolean,
	created_date timestamp NOT NULL DEFAULT now(),
	last_updated_date timestamp NOT NULL DEFAULT now()
);

create table IF NOT EXISTS ap_agents (
	ap_agent_id serial PRIMARY key,
	first_name VARCHAR NOT null,
	last_name VARCHAR,
	authorization_limit INT,
	start_date_active DATE NOT null,
	end_date_active date NOT null,
	email VARCHAR NOT null,
	created_date timestamp NOT NULL DEFAULT now(),
	last_updated_date timestamp NOT NULL DEFAULT now()
);

CREATE TABLE ap_invoice_headers (
	invoice_id serial PRIMARY key,
	invoice_number varchar NOT NULL unique,
	status int,
	invoice_created_date date NOT NULL,
	invoice_paid_date date,
	amount_invoiced int,
	amount_paid int,
	vendor_site_id int,
	invoice_currency_code varchar,
	payment_currency_code varchar,
	payment_method_lookup_code varchar,
	invoice_received_date date NOT NULL,
	agent_id int REFERENCES ap_agents,
	cancelled_by int REFERENCES ap_agents,
	invoice_cancelled_date date,
	amount_cancelled int,
	note_paid varchar,
	note_cancelled varchar,
	note_approval varchar,
	created_date timestamp NOT NULL DEFAULT now(),
	last_updated_date timestamp NOT NULL DEFAULT now()
);

CREATE TABLE ap_invoice_lines (
	invoice_line_id serial PRIMARY key,
	invoice_id int REFERENCES ap_invoice_headers,
	description varchar,
	po_line_id int REFERENCES po_lines, 
	amount_invoiced int,
	amount_paid int,
	created_date timestamp NOT NULL DEFAULT now(),
	last_updated_date timestamp NOT NULL DEFAULT now()
);








UPDATE mtl_items SET created_date = '2021-01-01', last_updated_date = '2021-01-01';
UPDATE po_headers SET created_date = po_created_date, last_updated_date = greatest(po_created_date, closed_date, approved_date);
UPDATE po_lines pl SET created_date = (SELECT created_date FROM po_headers ph WHERE pl.po_header_id = ph.po_header_id);
UPDATE po_lines pl SET last_updated_date = (SELECT last_updated_date FROM po_headers ph WHERE pl.po_header_id = ph.po_header_id);
UPDATE po_agents SET created_date = '2021-01-01', last_updated_date = '2021-01-01';
UPDATE ap_agents SET created_date = '2021-01-01', last_updated_date = '2021-01-01';
UPDATE ap_invoice_headers SET created_date = invoice_created_date, last_updated_date = GREATEST(invoice_created_date,invoice_paid_date, invoice_received_date, invoice_cancelled_date);
UPDATE ap_invoice_headers SET agent_id = 61 WHERE agent_id IS NULL AND mod(invoice_id, 2) = 0;
UPDATE ap_invoice_headers SET agent_id = 62 WHERE agent_id IS NULL AND mod(invoice_id, 3) = 0;
UPDATE ap_invoice_headers SET agent_id = 63 WHERE agent_id IS NULL;
UPDATE ap_invoice_headers SET cancelled_by = agent_id WHERE amount_cancelled IS NOT NULL;
UPDATE ap_invoice_lines al SET created_date = (SELECT created_date FROM ap_invoice_headers ah WHERE ah.invoice_id = al.invoice_id);
UPDATE ap_invoice_lines al SET last_updated_date = (SELECT last_updated_date FROM ap_invoice_headers ah WHERE ah.invoice_id = al.invoice_id);